import React, { Fragment, useEffect } from "react";
import { useSelector } from "react-redux";
import { transactionSuccess } from "../store/action.js";

export function Payment() {
  const { cardComLink } = useSelector((state) => state.mediaModule);

  useEffect(() => {
    const lowProfileCode = getLowProfileCode(cardComLink);
    console.log("lowProfileCode clean", lowProfileCode);
    // dispatch(transactionSuccess(lowProfileCode));
  }, []);

  const getLowProfileCode = (data) => {
    console.log("payment secsess page", data);
    const codeStart = data.indexOf("LowProfileCode=");
    const lowProfileCodeClean = data.substr((codeStart + 15) , data.length - 1);
    console.log("codeStart", codeStart);
    console.log('lowProfileCodeClean',lowProfileCodeClean);
    return lowProfileCodeClean;
  };

  return (
    <Fragment>
      <iframe src={cardComLink} width="480" height="800" title="ddd"></iframe>
    </Fragment>
  );
}
